<script setup lang="ts">

interface CDate {
    day: number;
    month: number;
    year: number;
}
interface Task {
    uuid: string,
    color: string,
    name: string,
    row: number,
    status: string,
    from: CDate,
    to: CDate,
    createdBy: string,
    assignees?: string[],
    description?: string
}
interface Assignee {
    uuid: string,
    image: string
}
const Title = "Timeline Title";
const tasks: Task[] = [
    {
        uuid: "507b54ba-7df0-45cb-9bd5-0e631e85b5a8",
        color: "#6495ED",
        name: "Home Office",
        row: 2,
        status: "",
        from: {day: 3, month: 4, year: 2024},
        to: {day: 5, month: 4, year: 2024},
        createdBy: "Mark Uch",
        assignees: ["507b54ba-7df0-45cb-9bd5-0e631e85b5a9"],
        description: "Descrip"
    },
    {
        uuid: "507b54ba-7df0-45cb-9bd5-0e631e85b5a8",
        color: "#6495ED",
        name: "Home Office",
        row: 4,
        status: "",
        from: {day: 18, month: 4, year: 2024},
        to: {day: 25, month: 4, year: 2024},
        createdBy: "Mark Uch",
        assignees: ["507b54ba-7df0-45cb-9bd5-0e631e85b5a9"],
        description: "Descrip"
    }
];
const assignees: Assignee[] = [
    {
        uuid: "507b54ba-7df0-45cb-9bd5-0e631e85b5a9",
        image: ""
    },
    {
        uuid: "507b54ba-7df0-45cb-9bd5-0e631e85b5aa",
        image: ""
    },
    {
        uuid: "507b54ba-7df0-45cb-9bd5-0e631e85b5ac",
        image: ""
    }
];

const startDragPos = ref(0);
const relativeDragPos = ref(0);
const tempDragPos = ref(0);

const draggingCalendar = ref(false);
const draggingTask = ref(false);
const draggingTaskExtension = ref(false);

const datesOffset = ref(0);
const datesPos = ref(0);


const screenSize = ref({width: 1920, height: 1080});


// start dragging
function startCalendarDragging(event: MouseEvent) {
    draggingCalendar.value = true;
    startDragPos.value = event.screenX;
}

function startTaskDragging() {
    draggingTask.value = true;
}

function startTaskExtensionDragging() {
    draggingTaskExtension.value = true;
}

// end dragging
function endDragging() {
    switch (true) {

        case draggingCalendar.value:
            draggingCalendar.value = false;
            relativeDragPos.value = tempDragPos.value;

        case draggingTask.value:
            draggingTask.value = false;

        case draggingTaskExtension.value:
            draggingTaskExtension.value = false;
    }
    console.log("END", "cal", draggingCalendar.value, "task", draggingTask.value, "extens", draggingTaskExtension.value);
}

// dragging
function moveCalendarComponents(event: MouseEvent) {
    // disable default dragging
    event.preventDefault ? event.preventDefault() : event.returnValue = false;

    // move calendar on drag
    if (!event.buttons) return;

    switch (true) {

        case draggingTaskExtension.value:
            console.log("task extension dragging");
            break;

        case draggingTask.value:
            console.log("task dragging");
            break;

        case draggingCalendar.value:
            tempDragPos.value = event.screenX - startDragPos.value + relativeDragPos.value;

            datesOffset.value = tempDragPos.value % 56;
            datesPos.value = tempDragPos.value / 56 < 0 ? Math.ceil(tempDragPos.value / 56) : Math.floor(tempDragPos.value / 56);

            break;
    }
}

function getScreenSize() {
    return {width: screen.width, height: screen.height};
}

function generateDate(dateNum: number) {
    const date = new Date(new Date().getTime() + dateNum * 86400000);

    const newDateNum = date.getDate();
    let day = "";


    switch (date.getDay()) {
        case 0:
            day = "S";
            break;
        case 1:
            day = "M";
            break;
        case 2:
            day = "T";
            break;
        case 3:
            day = "W";
            break;
        case 4:
            day = "T";
            break;
        case 5:
            day = "F";
            break;
        case 6:
            day = "S";
            break;
    }

    return day + " " + newDateNum;
}

function taskPlacementPos(task: Task) {
    const todayDayTimestamp = Math.floor(new Date().getTime() / 86400000);
    const taskStartDayTimestamp = Math.floor(new Date(task.from.year, task.from.month, task.from.day).getTime() / 86400000) + 4;
    const taskEndDayTimestamp = Math.floor(new Date(task.to.year, task.to.month, task.to.day).getTime() / 86400000) + 4 + 1;

    const taskLength = taskEndDayTimestamp - taskStartDayTimestamp;
    const timeFromToday = taskStartDayTimestamp - todayDayTimestamp;

    return {from: timeFromToday, to: timeFromToday + taskLength, taskLength};
}

onMounted(() => {
    screenSize.value = getScreenSize();
})

</script>

<template>
    <div class="flex flex-col w-full h-screen">
        <div class="py-4 shadow-md">
            <div class="px-4">
                <h1>{{ Title }}</h1>
            </div>
            <div class="relative flex justify-center w-full py-3 overflow-hidden">
                <p class="py-0.5 opacity-0">Dates</p>
                <div class="absolute flex" :style="{left: datesOffset - 5 * 56 + 'px'}">
                    <p v-for="date in Math.ceil(screenSize.width * 0.02 + 10)" class="w-14 py-0.5 text-center rounded-md text-gray-500 font-bold"
                    :class="{'bg-red-100': !(date - datesPos - 9), 'text-gray-900': !(date - datesPos - 9)}">
                        {{ generateDate(date - datesPos - 9) }}
                    </p>
                </div>
            </div>
        </div>
        <div class="flex-auto min-w-full mt-4">
            <div>
                
            </div>
            <div class="">
                <div @mousedown="startCalendarDragging" @mousemove="moveCalendarComponents" @mouseleave="endDragging" @mouseup="endDragging" class="grid overflow-hidden cursor-grab" :class="{'cursor-grabbing': draggingCalendar}">
                    <div v-for="row in 10" class="relative h-11 mb-0.5 bg-white">
                        <div v-for="task in tasks.filter(task => task.row === row-1)" @mousedown="startTaskDragging"class="absolute flex w-3/12 h-full left-5 rounded-md"
                            :style="{ backgroundColor: task.color, left: tempDragPos + (taskPlacementPos(task).from)*56 + 'px', width: taskPlacementPos(task).taskLength*56 + 'px' }"
                            >
                            <div class="size-full">
                                <div @mousedown="startTaskExtensionDragging" class="absolute left-0 z-20 w-3 h-full cursor-e-resize"></div>
                                <div @mousedown="startTaskExtensionDragging" class="absolute right-0 z-20 w-3 h-full cursor-e-resize"></div>
                                <div class="size-full p-1 pl-2">
                                    <div class="relative size-full">
                                        <div class="flex items-center h-full">
                                            <h3 class="leading-none select-none">{{ task.name }}</h3>
                                        </div>
                                        <div class="absolute flex items-center h-full right-1 top-0">
                                            <div class="relative size-8 select-none">
                                                <img v-for="num in 3" :src='"data:image/jpg;base64," + assignees[num-1].image' class="absolute size-full rounded-full object-cover" :style="{ right: (num-1)*1.4 + 'rem', 'z-index': num+10 }">
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
</template>

